function App() {

  const [val,setval]=useState('');
  const ChangeHandler=(e)=>{
   List.push(val)
   setval('')
  }
  return (
    <>
        <input type='text' value={val} onChange={(e)=>setval(e.target.value)}
        >
        </input>
        <button onClick={ChangeHandler}>Go</button>

        {List.map((hh)=>(
          <div className='hey'>
          <input type='checkbox' />
          <h1>{hh}</h1>
          </div>

        ))}
        </>
  );
}

export default App;
